export const ACCCOLUMNS = [
    {
        Header: 'Name',
        accessor: 'name'
    },
    {
        Header: 'Address',
        accessor: 'address'
    },
    {
        Header: 'City',
        accessor: 'city'
    },
    {
        Header: 'State',
        accessor: 'state'
    },
    {
        Header: 'Zip Code',
        accessor: 'zip_code'
    }
]
